import React from 'react'
import Product from './Product'
import productItems from "./productApi";



function Home() {

    return (
        <div>
            <div className="home">
                <div className="container ">

                    <div >
                        {productItems.map((item) => (
                            <Product

                            key ={item.id}
                            title={item.title}
                            pricing={item.pricing}
                            qty ={item.qty}
                            image={item.image}
                       />)) }


                </div>


            </div>



       </div></div>

    )
}

export default Home
